import axios from 'axios';

const token = 'seu_token_aqui'; // Substitua pelo token real
axios.get('http://127.0.0.1:8000/api/ativos/', {
    headers: {
        Authorization: `Token ${token}`
    }
})
.then(response => {
    console.log(response.data);
})
.catch(error => {
    console.error(error);
});
